(19, 1, 5, 0, '- Efterspørgselsanalyser er fokus i denne måned -> SEO strategi i Marts<br/>- DE -> genaktiver google search ads der tidligere har performet (men med lavt spend)<br/>- Tag billede af nye smykkeprodoukter og tease på social<br/>- Tommy følger op med Peter Stjerne i Google shopping -> Jakob har sendt herom<br/>- Tour de france nøglering'),
(20, 2, 5, 0, 'CDP udvikling<br/>-	Tommy laver DM plan herfor<br/>-	Udvikling sker i uge 5 såfremt godkendelse.<br/>Social:<br/>-	Valentine fokus<br/>-	Kreativer på Valentine lykkehjul. Separat budget.<br/>-	Conversion API gennem Segment sættes op uge 5 hvis godkendelse på DM plan<br/>SEO:<br/>-	Kort dataanalyse: Hvorfor ser vi et dyk i performance.<br/>-	Påske: ”påskeæg til voksne”, ”påskebuketter” (collection). Hvad giver mening?<br/>-	Løbende linkbuilding<br/>-	Briefing på onpage contenteksekveringer<br/>Google Ads:<br/>-	Valentine fokus<br/>-	Berigelse af feed - Channable <br/>-	Omstrukturering af account til hagakure (kræver dog kundens accept)<br/>MA: (moon briefer)<br/><br/>Kampagneplanning:<br/>-	Formål, budskab, målsætninger?<br/>-	Taktik til occasions<br/>-	Skjulte LP’er til occasions – Fx mors dags buket landingpage til opsamling af permissions hele året rundt<br/><br/>Projekter til indsalg:<br/>-	CRO <br/>-	Affiliate til occasions<br/>'),
(21, 73, 8, 0, ''),
(22, 74, 8, 0, ''),
(23, 2, 6, 0, 'CDP udvikling<br/>- Tommy laver DM plan herfor<br/>- Udvikling sker i uge 5 såfremt godkendelse.<br/>Social:<br/>- Topfunnel, brandpositionering. Vi kommer med bud på hvad der skal defineres.<br/>- Conversion API gennem Segment sættes op deadline marts.<br/>SEO:<br/>- Følg op på dataanalyse actions.<br/>- Følg op på om Påskeblomster LP er optimeret fra kundens side?<br/>- Løbende linkbuilding med fokus på påske<br/>- Briefing på onpage contenteksekveringer til mors dag.<br/>Google Ads:<br/>-	Valentine fokus<br/>-	Berigelse af feed - Channable <br/>-	Omstrukturering af account til hagakure (kræver dog kundens accept)<br/>MA: (moon briefer)<br/><br/>Kampagneplanning:<br/>-	Formål, budskab, målsætninger?<br/>-	Taktik til occasions<br/>-	Skjulte LP’er til occasions – Fx mors dags buket landingpage til opsamling af permissions hele året rundt<br/><br/>Projekter til indsalg:<br/>-	CRO <br/>-	Affiliate til occasions<br/>'),
(24, 1, 6, 0, 'Tenna og Peter:<br/>- Opdaterer kampagneplan<br/>- Opretter Google Drev mappe til samling af kreativer<br/>- Tænker 1. april kampagne -> Kan det noget?<br/><br/>KYNETIC:<br/>- 3 x fokus: Kampagne 15% på greb + Bordkort (bryllup/konfirmation) + produktnyheder<br/>- Tommy opsætter møde med Peter og Tenna til gennemgang af efterspørgselsanalysen<br/><br/>Noter:<br/>- Greb + bordkort skal drive primært salg i marts<br/>- Smykker -> kommer på lager ca. medio april<br/><br/>Target omsætninger for marts inkl. moms:<br/>- DK: ca 450.000 DKK<br/>- NO: ca 300.000 NOK<br/>- SE: 140-150.000 SEK'),
(25, 3, 6, 0, 'TEST'),
(26, 15, 6, 0, 'Paid Search:<br/>- Opgaver: Shopping afviste produkter. 0krs produkt-løsning. Sammenlægning af kampagnestruktur på kampagneniveau ifm udfasning af ETA\'er. Stresstest kampagne på lead gen - god start på den.<br/>Midfunnel test afsluttet (præmis mikrokonvertering - evaluerings kriterie salg)<br/>Road map: Q1 kampagnestrukt, ETA udfasning, Udrulning af Smartshopping og feed. Dashboard feedback. Lead gen test (stresstest)<br/>- Deadlines: Juni for kampagne struktur. resten er løbende.<br/>Organic Search:<br/>- Opgaver: Magnus er blevet primær person på denne. Alt er live og processen kører godt med.<br/>- Deadlines: Update på resulater i midt/slut marts til feedback til bonnier - Klynge/magnus er på denne.<br/>Analytics:<br/>- Opgaver: Generelt fin optstart. \"SEO basker\"-analyse på HIS/ILL uden Paywall. Nye opgaver: Andele i digitalt salg imellem lande + performance af \"slideins i footer\". Har ikke kigget på CRO test endnu pga andet fokus i organisationen.<br/>- Deadlines: Ikke eksplicitte deadlines, udover at SE opgaver har højest prio.<br/>Paid Social:<br/>- Opgaver: Splittest af CPO m. lowest costs/cost cap - Spark AR skal nu testes af i strukturen i DK, som har til formål at højne engagements i DPA.<br/>- Deadlines: Produktion af AR i marts og test i april mdr. MK bygger & præsenterer Paid Social road map for KYNETIC team (JS/MM) og derefter også for Bonnier Social team (vigtigt Pelle er med på denne mød)<br/>Lead Gen- lead:<br/>- MM/JS er på en mulig opgave her.'),
(27, 32, 6, 0, 'test'),
(28, 13, 6, 0, '-'),
(29, 75, 8, 0, ''),
(30, 74, 6, 0, ''),
(31, 2, 7, 0, 'CDP udvikling<br/>- Aktivering af data og segmenter og drage så mange indsigter fra setup\'et som muligt.<br/>Social:<br/>- Påske performance fokus.<br/>SEO:<br/>- Løbende linkbuilding med fokus.<br/>- Briefing på onpage contenteksekveringer.<br/>MA:<br/>- Opfølgning abandonned cart (længerevarende pga. få data)<br/>- Remarketing på påskeblomster'),
(32, 15, 7, 0, 'Paid Search:<br/>- Opgaver: <br/>Shopping afviste produkter. <br/>Supplerende feeds til google snakker klynge med Bonnier om (forkert mediekode fra tidligere, kun på FB)<br/>Sammenlægning af kampagnestruktur på kampagneniveau ifm udfasning af ETA\'er. <br/>Stresstest kampagne på lead gen - går fortsat godt.<br/>Midfunnel test afsluttet (præmis mikrokonvertering - evaluerings kriterie salg)<br/><br/>Road map: <br/>Q1 kampagnestruktur, ETA udfasning, Udrulning af Smartshopping og feed. Dashboard feedback. Lead gen test (stresstest)<br/>- Deadlines: Juni for kampagne struktur. resten er løbende.  <br/><br/>Organic Search:<br/>- Opgaver: Magnus er blevet primær person på denne. Alt er live og processen kører godt med på link projektet.<br/>- Deadlines: Update på resulater i midt/slut marts til feedback til bonnier - Klynge/magnus er på denne.<br/><br/>Analytics:<br/>- Opgaver: Generelt fin optstart. \"SEO basker\"-analyse på HIS/ILL uden Paywall. <br/>Nye opgaver: Andele i digitalt salg imellem lande + performance af \"slideins i footer\", som kommer til at blive fokus for april.<br/>Har ikke kigget på CRO test endnu pga andet fokus i organisationen.<br/>- Deadlines: Ikke eksplicitte deadlines, udover at SE opgaver har højest prio.<br/><br/>Paid Social:<br/>- Opgaver: <br/>Marts har haft fokus på Spark frem for DPA. Spark Lanceres i dag 1/4. DM planen skiftes om, til at have de samme timer, men med kreativt fokus. <br/><br/>- Deadlines: <br/>Produktion af AR i marts og test i april mdr. <br/>MK bygger & præsenterer Paid Social road map for KYNETIC team og derefter også for Bonnier Social team (vigtigt Pelle er med på denne møde)<br/><br/>Lead Gen- lead:<br/>- MM/JS er på en mulig opgave her.'),
(33, 1, 7, 0, 'Tenna og Peter:<br/>- Opdaterer kampagneplan -> Done<br/>- Opretter Google Drev mappe til samling af kreativer - Er det sket?<br/>- Tænker 1. april kampagne -> Kan det noget? -> Droppet<br/>- Shoppen er opsat til mors dag -> Annoncering skal starte op mandag på DK<br/><br/>KYNETIC:<br/>- 3 x fokus: Kampagne 15% på greb + Bordkort (bryllup/konfirmation) + produktnyheder -> Evaluering - hvordan er det gået?<br/><br/>Noter:<br/>- Greb + bordkort skal drive primært salg i marts<br/>- Smykker -> kommer på lager ca. medio april<br/><br/>Target omsætninger for marts inkl. moms:<br/>- DK: ca 450.000 DKK -> Var kun 321. 000 kr.<br/>- NO: ca 300.000 NOK - > Var kun 145.000 kr. total (greb alene solgte for 150.000 kr i marts sidste år (47 i år) -> det var 155.000 i april sidste år)<br/>- SE: 140-150.000 SEK  -> Var kun 123.000 kr.'),
(34, 13, 7, 0, 'April: <br/><br/>Overordnet: <br/>Nyt budget de næste mdr: 40 -> 70.000 kr. <br/>Fordeling: <br/>10.000 til positioning/branding<br/>25.000 til SME<br/>35.000 til Growth<br/><br/>Google Ads: <br/>Opbygning af ny kontostruktur - status?: Styr på keywords. Mangler annoncer, der passer til det, og derefter opsættes struktur. Deadline EOW 14. <br/>Redirects går live. <br/><br/>Paid Social: <br/>Nyt framework og struktur<br/>- Igangsætning af Optimizer kampagne og brand awareness med Bisnode video fra LinkedIn. <br/><br/>Organic Social: <br/>Status på organiske opslag?<br/>-> <br/>Følgere status -> 225<br/><br/><br/>Dashboard -> struktur lavet, deadline for v.1 EOW 14<br/><br/><br/><br/><br/>'),
(35, 50, 7, 0, 'April:<br/>Generelt: <br/>- Ny currency på sitet med USD<br/>- Nye produkter live <br/>- Paypal live - tyskland interessant. <br/><br/>Search:<br/>- Afklaring af feed tool. Simon snakker fre. d. 1. med DFW. Følg op herpå ->KO<br/>- Kom ud med bedste brands i search (top 5 brands). <br/>- Google Shopping skal op og køre. <br/><br/>Social:<br/>- Opsætning af integrationer med Klaviyo og FB til nye audiences ->KO/ TA kan hjælpe<br/><br/>Linkbuilding:<br/>- Magnus skal hjælpe Charlotte med linkbuilding overblik. Kan vi allerede se noget? De mangler lidt indsigt.<br/>'),
(36, 51, 7, 0, 'Generelt konverterer folk ikke så meget i markedet, som de plejer. <br/><br/>SEO: <br/>Opgaver: Content på sitet skal implementeres denne måned fokus er FAQs og vi følger op. <br/>SEO team skal holdes i loopet på implementeringer af content, når det bliver implementeret. <br/><br/>MA:<br/>Moon fraværende/syg på dagen for sprint opstart. <br/><br/>Paid Search:<br/>Opgaver: Meget efterspørgsel i markedet, men meget lidt konvertering, som tilskrives at man kun kan købe 1 palle pr. pers altså udbuddet i markedet.<br/>Fokus er at få ROAS skarp få øje.   <br/><br/>Paid Social:<br/>Satte gang i kampagner på brændetårne i uge 12/13. Sker for lidt på disse - fokus er på optimering af disse. Fokus er at følge performance og udvikle så ROAS passer. <br/>Betalingsgateway er lige blevet skiftet, som kan være årsag her. <br/><br/>CDP: <br/>Jeppe har bolden på denne. '),
(37, 4, 7, 0, 'SEO:<br/>- Lav crawl i Screaming Frog mhp. redirects (MN)<br/>- Strategi: Topic cluster visualiseringer, potentialeberegninger på clucsters, opdatering af contentplan, kunderejsemapping (MN)<br/><br/>Webmanagement: <br/>- Opsætning af landingpages inkl. definition på hvordan en services side ser ud (MN+RV)<br/>- Overflytning af projekter (MN+RV)<br/><br/>Social:<br/>- Opfølgning på nye kreativer (NN)<br/>- Tager kig på MA setup (NN)<br/><br/>Paid Search:<br/>- Dataanalyse, drift af setup og udbygning (RV)<br/>'),
