(1077, 'Tracking - facebook puchase value-værdien kommer ikke med ', '6.00', '8.00', 3, 'Facebook purchase value-værdien kommer ikke med. Løsning: Ændre Server-side opsætning, så værdierne kan trækkes fra DataLayer', 6, 0, 32, 1, 2, 6, 0, 0),
(1078, 'Dashboard udbygges ', '1.00', '2.00', 3, 'Det dashboard der er lavet til garnværkstedet, skal udbygges med de sidste ting. Tag en snak med kristina inden dette gøres, for at klarlægge hvilke ting vi skal have med. ', 6, 0, 32, 1, 2, 6, 0, 0),
