(1084, 'Efterbehandling af Kreativ Workshop ', '4.00', '6.00', 3, 'PP præsentation der præsenterer bud på annoncekommunikation til de indledende annoncer, som sendes til kunden og godkendes inden annoncerne aktiveres. <br /><br />Altså en præsentation af det produkt vi har fået ud af den kreative workshop ', 6, 0, 16, 1, 2, 8, 0, 0),
(1085, 'Tech og data afklaring: Kortlægning af data-flows og behov/benchmarking for systemer/værktøjer til at eksekvere strategien på kort og lang sigt - inkl. Møde hvor det præsenteres', '2.00', '3.00', 3, 'Det nødvendige outcome som en teknisk workshop er egentlig afklaret og kortlag. Kristian Moon opsummerer overvejelser og findings udført ifb. med denne opgave. \r\n\r\nAfholdes som onlinemøde. ', 6, 0, 16, 1, 2, 4, 0, 0),
(1086, 'Off-time', '8.00', '8.00', 3, 'Fri fredag 04-03-2022<br /><br />test\'\'da\'wd2a\'', 6, 0, 56, 3, 1, 8, 0, 0),
(1087, 'Workshop: Skalering til flere brands (sker som behandling på den kreative workshop) og  behandling af brands/markedsdinsigt', '5.00', '7.00', 0, 'dette er en del af den kreative workshop, hvor vi skal have afdækket annonceringskommunikationen for CPI. <br /><br />Hvad skal vi have kommunikeret ud og hvad er målsætninger for CPI?', 6, 0, 16, 1, 2, 8, 0, 0),
(1088, 'Demand Cockpit og efterspørgselsanalyse for 3-4 markeder (3-4 sproglag X alle produktområder)', '8.00', '10.00', 3, 'Efterspørgselsanalysen skal præsenteres for Janni igen, på en onlineworkshop. Her går I, i dybden med analysen. \n- Hvorfor er det vi laver den\n- hvad kommer der ud af den\n- jeres indput (hvorfor og hvordan har vi brugt dem)\n- Hvorfor ser den ud som den gør nu\n- Hvad tager vi så med fra den og hvordan bruger vi den fremadrettet.\n\nHerefter har Janni mulighed for at stille spørgsmål og komme med tilføjelser ift. konkurrenter/brands mv. \nVi laver en sidste berigelse med mulige nye input og præsenterer kort derefter. Herefter er opgaven done. \n\nSe fasttrack-plan for leveringsdato ', 6, 0, 16, 1, 2, 1, 0, 0),
(1089, 'Audit af websitet for sikring af flows, digital marketing best pratices og understøttelse af kundernes/brugernes behov digitalt', '3.00', '4.00', 3, 'Audits for CPI og Borg er færdige. De skal præsenteres for kunden på et onlinemøde. \r\n\r\nSe fasttrack-plan for mødedato. ', 6, 0, 16, 1, 2, 1, 0, 0),
(1090, 'Content planning: Databaseret (pull) + push prioritering af content produktion både onsite og offsite baseret på forudgående Kickoff workshops, markedsindsigt og Demand Cockpit (efterspørgselsanalyse)', '4.00', '5.00', 3, 'Kontentplanen beriges med push orientering af contentproduktion. \r\nInformationer hertil, leveres af Kristina efter Kreativ Workshop, hvorefter planen beriges og udvides. \r\n\r\nPlanen præsenteres efterfølgende for Janni på en online gennemgang med mulighed for Q&A.\r\n\r\nse fasttrack plan for opgavedeadline', 6, 0, 16, 1, 2, 1, 0, 0),
(1091, 'Kampagneplanlægning, stuktur og proces: Afdæktning af performance setups (always on) og særskilte kampagner over året og heri behov for, segmenter content og ads hertil', '5.00', '7.00', 3, 'KYNETIC laver en timeline for 2022 med budskaber og always-on kampagner og Borg og Kynetic Bygger det ind i årshjul sammen.\r\n\r\nKynetic laver tidslinje med budskaber på always on og kampagner og BORG og Kynetic bygger det ind i årshjul sammen. Klarlægges på Kreativ Workshop i samråd og nedfældes på bagkant.', 6, 0, 16, 1, 2, 7, 0, 0),
(1092, 'Kortlægning og planlægning for tilpasninger til flere brands (FOR CPI) (kampagneplanlægning, struktur og proces for CPI)', '4.00', '6.00', 3, 'For CPI: Kampagneplanlægning, stuktur og proces: Afdæktning af performance setups (always on) og særskilte kampagner over året og heri behov for, segmenter content og ads hertil\r\n\r\nKynetic laver tidslinje med budskaber på always on og kampagner og BORG og Kynetic bygger det ind i årshjul sammen. Klarlægges på Kreativ Workshop i samråd og nedfældes på bagkant.', 6, 0, 16, 1, 2, 7, 0, 0),
(1093, 'Opbygning af annonceringssetup via KYNETIC frameworks målrettet de udvalgte segmenter på tværs af kanaler (social, search, display m.fl.)', '10.00', '13.00', 3, 'Opbygning af annonceringssetup via KYNETIC frameworks målrettet de udvalgte segmenter på tværs af kanaler (social, search, display m.fl.) \n\nFor CPI: skærmdelingssession hvor vi får adgang til alle konti og får oprettet dem der mangler. herefter opsættes framework.\n\nmangler der noget for BORG Automotive skal dette færdiggøres, så det hele er klar til begge brands. ', 7, 0, 16, 1, 2, 3, 0, 0),
(1094, 'Kreativ udvikling, adoptering og versionering af annoncer inkl. QA', '4.00', '6.00', 3, 'Kynetic opsætter annoncer og splittest varianter for både BORG og CPI\n\nDette betyder blot, at der skal opsættes splittests på annoncerne. Forskellige USP\'er /overskrifter og lignende. \n\n', 7, 0, 16, 1, 2, 3, 0, 0),
(1095, 'Etablering og produktion af annonceringssetup for flere brands', '4.00', '5.00', 3, 'annoncerne sættes laves og opsættes for både Borg Automotive og CPI', 6, 0, 16, 1, 2, 3, 0, 0),
(1096, 'KPI og trackingmøde for afklaring af det nødvendige tracking på tværs af site, i GA og dashboard/cockpit behov', '3.00', '5.00', 0, 'Møde afholdes mellem Borg / CPI og Kynetic, for at afdække de hvilke ting vi skal tracke på og hvilke målepunkter der skal fremhæves i dashboard.', 6, 0, 16, 1, 2, 6, 0, 0),
(1097, 'Opsætning af integration imellem CRM og marketing automation værktøj', '1.00', '2.00', 3, '', 6, 0, 16, 1, 2, 4, 0, 0),
