(1099, 'Leadscorings workshop for kortlægning af leadscoring og herunderliggende data, flows mv.', '5.00', '7.00', 0, 'Der skal afholdes en workshop (online eller fysisk møde) med Janni og salg, hvor leadscore kortlægees og flow berammes og belyses for salg. Skal skal sættes ind i, hvornår de skal tage fat i kunder og vide hvilke flows kunderne kommer igennem. ', 7, 0, 16, 1, 2, 4, 0, 0),
