(1117, 'Tilpasning til udrulning af flere brands (Dashboard skal udbygges med KPIer/ målepunkter for CPI)', '2.00', '3.00', 3, 'Tilpasning til udrulning af flere brands - Dashboard udbygges med målepunkter for CPI. Hvis ikke det er muligt, skal der laves et simpelt dashboard med målepunkter for CPI.<br /><br />EDIT: bruges på dashboard (salg, marketing og ledelsen) og møder herom', 8, 0, 16, 1, 2, 6, 0, 0),
(1118, 'Tracking overvågning og sikring af data', '2.00', '4.00', 3, 'sikre at tracking spiller på alle kanaler, både på Borg og CPI. \r\n\r\ndet er en løbende opgave. Den ligger hver måned og skal sikre at vi ikke har nedbrud, eller at vi opdager dem hurtigt, såfremt der er noget der ikke fungerer optimalt. ', 6, 0, 16, 1, 2, 6, 0, 0),
