(1928, 'undervisning hos Borg: Kampagnetekster', '6.00', '8.00', 3, 'Fysisk undervisning hos Borg. der er afsat 2-3 timer til den fysiske undervisning. \r\n\r\nDu er selv ansvarlig for at booke en undervisning ind med Janni i starten af sprintet. \r\n\r\nUndervisning: fra budskab til annoncemateriale (always on spor - High, mid low kommunikation). Hvordan skaber vi gode kampagnetekster og kreativer ud fra de valgte budskaber. Hvordan skal tekster og KPI\'er ændre sig, ud fra det aktuelle spor', 11, 0, 16, 1, 2, 8, 0, 0),
