(2224, 'MA optimering', '16.00', '20.00', 3, 'Revideret take på skabelon (laves som ny kopi - Kasper godkender)<br />- Ny version med små optimeringer<br /><br />Tagging og content scoring implementeres<br /><br />Datavask og oprydning af data, felter og lister - og fjerne spam-subs (inkl. fjerne dubletter og evt. konsolidere lister/data)<br />- Bounces slettet<br />- Customfields slettet<br />- Lister slettet<br />- Tags slettet<br /><br />Re-navngivning af tags og dertil tilrette flows/segmentering<br /><br />Opsætning og aktivering af scorings<br />Notikation ved en \"varm bruger\" med højt engagement<br />Seperate tags til \"deltog i webinar\" og \"tilmeldt webinar\" - begge skal have materialer efterfølgende i flows<br /><br />Nyt webinar flow - (undersøg webinarjam): <br />- Spcificeret - under opbygning<br /><br />Sæt SMS på i formularen til tilmelding inkl. på site<br />Får tilmeldingskvittering inkl. webinarjam link straks ved tilmelding<br />Reminder 3 dagen før via mail (nuværende skabelon) med link også<br />Light reminder dagen før via mail (meget lige på med \"det er i morgen\" og link)<br />SMS en time før med reminder<br /><br />Velkomstflowet får en overhaling og bliver up to date. (Nyt frisk indhold, segmentering mv.) og evt. forgrening til flere/mere specifikke flows<br /><br />Tjek øvrige flows igennen og opdater dem hvis brug for. Whitepaper flows mm.<br /><br />Ideer til nye flows?', 11, 0, 56, 1, 1, 4, 0, 0),
