(2344, 'Undervisning Google Ads', '7.00', '8.00', 3, 'Undervisning \r\n\r\nUndervisningsbeskrivelse:\r\nGoogle Ads - Her gennemgår vi mulighederne for annoncering på platformen. \r\nhvilke annonceringsformater er der og i hvilke henseender giver det mening at \r\nbruge de forskellige. Hvordan bygger vi annoncer og skaber strukturen for \r\nannonceringssetuppet. Slutteligt kigger vi på tracking af annoncerne og dykker ned \r\ni de data vi kan se og hvordan vi bruger dette til at optimere- og udbygge kontoen. \r\n\r\nUndervisningen bør tage omkring 3 timer.', 11, 0, 16, 1, 2, 2, 0, 0),
