(2366, 'Opdatering af Black Friday-blogindlæg', '4.00', '6.00', 3, 'Rette eksisterende indhold til, så det holder sig relevant<br /><br />Opdatering af blogindlæg i Google Doc: https://docs.google.com/document/d/1485yEgBofD6xVcofs82ArN6fP3TK5_HMgAl4cTWD5P4/edit#', 11, 0, 58, 1, 1, 7, 0, 0),
(2367, 'Korrektur på website', '6.00', '15.00', 3, 'Følgende servicesider skal have en tekstmæssig overhaling:<br /><br />SEO<br />Annoncering og PPC<br />Marketing automation<br />Analyse og indsigt<br />Digital strategi<br /><br />De ligger med link i contentplanen under fanen contentopdatering: https://docs.google.com/spreadsheets/d/174RUB8TWd8sExlrbJIPLqV0fBREoX2q7cLUzj-ZsRd0/edit#gid=834021718<br /><br />Kig gerne på gentagelser, informationshirearki osv.<br /><br />Kopier teksten over i et Google Docs, så giver jeg feedback på det :)<br /><br />Du må gerne sætte din faglighed i spil og stille spørgsmål til, hvorfor det er skrevet som det er - nogle gange er der en god grund, andre gange er det bare fordi, nogen har set sig blind på det eller det er gået lidt hurtigt. ;)', 12, 0, 58, 1, 1, 7, 0, 0),
