(2374, 'Opdatering af Black Friday whitepaper', '6.00', '8.00', 3, 'Vores whitepaper om Black Friday skal have en opdatering, så det er relevant for 2022.<br /><br />Link: https://docs.google.com/presentation/d/174xx5LSaXsDzf14BZK_Lj9uFtRbWykIE/edit#slide=id.p1<br /><br />Whitepaperet skal have:<br /><br />1. Nye billeder (den skal fremstå \"ny\")<br />2. Tal på slide #5 skal opdateres med nye tal og årstallene skal opdateres<br />3. Tjek om grafen på slide #6 stadig stemmer (Google Trends)<br />4. Opdater billede på slide #12 (brug Wayback machine)<br />5. Tag fat i Frederik eller Mads for at høre, om der er nogle nye trends, som de vil anbefale i forhold til social annoncering<br />6. Tag fat i Kristian Klynge og hør, om der er noget, de anbefaler på Google Ads, som ikke er med<br />7. Opdater slide 15, 17, 23 (nye tal), <br />8. Tag fat i Kristian Moon og spørg, om anbefalinger på e-mail stadig er relevante<br />9. Opdater slide 25 og 26 (hvis der er noget at opdatere)', 11, 0, 58, 6, 1, 7, 0, 0),
