(2410, 'Kick-off Workshop', '12.00', '14.00', 3, 'Opstartsmøde/Workshop som sikrer den et godt fundament for samarbejdet og den rette eksekvering. På workshoppen kommer vi omkring; Fokus i opgaver/rollefordelinger, kortlægning af KPI\'er, VPs/USP\'er, segmenter, kanal-taktikker, markedsmekanismer, kunderejsen mm.', 12, 0, 83, 1, 2, 18, 0, 0),
