(2412, 'Overtagelse af Facebook setup', '9.00', '11.00', 3, 'Overtagelse af Facebook setup - Introduktion, baggrund og generel opsætning', 12, 0, 83, 1, 2, 3, 0, 0),
(2413, 'Opsætning af Facebook datastrukturer', '4.00', '5.00', 3, 'Opsætning af best practise datastrukturer inkl. opsætning af aktiver, Tracking setup og Målgruppeintegrationer', 12, 0, 83, 1, 2, 3, 0, 0),
(2414, 'Oprydning i pixel-data samt kortlægning i pixel adgange', '3.00', '5.00', 3, 'Der skal skabes et overblik i, hvilke pixels som skal beholdes og, hvilke som skal udgå på websitet. Dertil skal der opsættes datadeling mellem det \"primære\" pixel, som i dag eges af Hilmar og Høgsberg og det valgte pixel.', 12, 0, 83, 1, 2, 3, 0, 0),
(2415, 'Optimering af budstrategier', '3.00', '4.00', 3, 'Brand kampagne anvender i dag mål-CPA og har YTD mistet 21,52% eksp. andel på brand søgninger pga. denne budgivning. Vi anbefaler at anvende udvidet CPC mhp. \"altid\" at være synlig på brand søgninger.<br />På resterende søgekampagner anvendes ligeledes mål-CPA, hvilket med andre ord betyder vi optimerer efter at betale 480 kr. for alle typer af konverteringer, men konverteringerne er ikke det samme værd. Derfor bør Eurodan overgå til budstrategien \"Maksimer konverteringsværdi\".', 12, 0, 83, 1, 2, 2, 0, 0),
(2416, 'Håndtering og restrukturering af konv. tracking', '4.00', '5.00', 3, 'Lige nu tæller \"Bestil fysisk Katalog 2020\" og \"Møde booking 2020\" begge som en konvertering. Mhp. at gå til næste niveau bør disse konverteringer differentieres mhp. at optimere mod konv. værdi (altså der hvor værdien er størst). Konverteringer som er sekundære for Eurodan bør angives som sekundære fx konverteringspunktet \"Nyhedsbrev 2022\".', 12, 0, 83, 1, 2, 2, 0, 0),
(2417, 'Optimering af kontostruktur gennem implementering af KYNETIC Ads Framework', '7.00', '9.00', 3, 'Setup\'et består af 1 brand kampagne, 3 generiske kampagner og en generisk DSA kampagne. Fælles for alle søgekampagner er at de indeholder en lang række annoncegrupper, hvilket ikke skaber særlig gode forhold for en algoritmisk budstrategi som fx mål-CPA. Den algoritmiske budgivning er fremtiden, men det understøtter strukturen ikke i dag. I anbefales at konsolidere annoncegrupper.', 12, 0, 83, 1, 2, 2, 0, 0),
(2418, 'Optimering af annoncer og budskaber inkl. RSA udrulning', '5.00', '6.00', 3, 'Idet annoncegrupper konsolideres kan man blive bekymret for om kommunikationen bliver lige så relevant. Det gør den med Responsive Search Ads (RSA), ved brug af elementer som fx keyword insertion som indsætter den konkrete søgestreng brugeren efterspørger. Ligeldes understøtter RSA\'er mulihgeden for at kombinere overskrifter og beskrivelser på kryds og tværs som gør at algoritmen har mere kommunikation at vælge mellem og dermed matcher efterspørgsel med kommunikation baseret på hvad der har performet tidligere. I øvrigt er Expanded Text Ads et udgået annonceformat, som kontoen i primært anvender i dag og endvidere har jeres få RSA\'er ikke en høj nok annoncekvalitet.', 13, 0, 83, 1, 2, 2, 0, 0),
(2419, 'Automatisering af elementer i Google Ads setup', '3.00', '4.00', 3, 'I anbefales at arbejde med regler og scripts til at sikre oppetid og et minimum af fejl der kan påvirke performance over længere tid (herunder undgå afviste ads) samt sikre at spendings, ratio mellem spend og konv. værdi mv. er on target.', 13, 0, 83, 1, 2, 2, 0, 0),
(2420, 'Optimering af annonceudvidelsessetup', '4.00', '5.00', 3, 'De enste udvidelser der anvendes på kontoen er hhv. appudvidelse, opkaldsudvidelse og adresseudvidelse. I anbefales at opsætte undersidelinks og infoudvidelser mhp. større blikfang på søgeresultatsiden.', 13, 0, 83, 1, 2, 2, 0, 0),
(2421, 'Implementering af Performance Max', '8.00', '9.00', 3, 'Performance Max er et nyt kampagneformat som konsoliderer alt fra Search, Display, Youtube, Gmail, Discover og Maps i en kampagne. I har indtil videre ikke anvendt formatet, hvilket I anbefales at teste, da vi ser rigtig stærke resultater på tværs af andre cases. Formatet er bundet op på målgrupper frem for keywords og erstatter trods sin konsoliderede form ikke fundamentet i jeres setup, nemlig Search Ads.', 13, 0, 83, 1, 2, 2, 0, 0),
(2422, 'Komplet teknisk SEO site audit ', '7.00', '9.00', 3, 'For at sikre dette tekniske SEO fundament foretager vi et komplet site audit hvor vi gennemgår sitet fra A-Z, og tjekker over 100 faktorer igennem som alle har en indflydelse på hvordan I ranker i Google. Dette vil blive leveret i form af en implementerbar rapport, hvori de nuværende problematikker og løsningsforslag er beskrevet.', 12, 0, 83, 1, 2, 1, 0, 0),
(2423, 'Udarbejdelse af komplet efterspørgselsanalyse', '9.00', '11.00', 3, 'Den komplette søgeadfærd i markedet kortlægges mhp. at skabe det fulde overblik over den efterspørgsel der er relevant at afdække for Eurodan Huse inkl. topfunnel og evt. ny markedsefterspørgsel her. Alt dette samles i vores Demand Cockpit som i øvrigt giver et forkrommet indblik i hvordan I står ift. at afdække efterspørgslen kontra jeres konkurrenter.', 12, 0, 83, 1, 2, 1, 0, 0),
(2424, 'Skræddersyet Performance Cockpit', '15.00', '17.00', 3, 'Afstemning og implementering af skræddersyet Performance Cockpit via Google Data Studio som styrings- og -rapporteringsværktøj for primære forretnings- og -marketing KPI\'er', 13, 0, 83, 1, 2, 18, 0, 0),
(2425, 'Share of Search måling', '10.00', '12.00', 3, 'Share of search (top, mid og low funnel) nulpunktsmåling samt autoamtisk løbende målinger til cockpittet', 13, 0, 83, 1, 2, 16, 0, 0),
(2426, 'Attributionsmodellering', '7.00', '9.00', 3, 'Afklaring af korrekt model og opsætning af tracking, måling og rapportering i Google Analytics, samt øvrige relevante kanaler med den styrende model - samt adhov analyse for korrekt allokering af adspends baseret på historiske data', 13, 0, 83, 1, 2, 6, 0, 0),
