(2430, 'Implementering af Performance Max', '4.00', '5.00', 3, 'Performance Max er et nyt kampagneformat som konsoliderer alt fra Search, Display, Youtube, Gmail, Discover og Maps i en kampagne. I har indtil videre ikke anvendt formatet, hvilket I anbefales at teste, da vi ser rigtig stærke resultater på tværs af andre cases. Formatet er bundet op på målgrupper frem for keywords og erstatter trods sin konsoliderede form ikke fundamentet i jeres setup, nemlig Search Ads.', 13, 0, 83, 1, 2, 2, 0, 0),
(2431, 'Optimering i brugen af målgrupper', '4.00', '5.00', 3, 'Brugen af målgrupper bør intensiveres ved bl.a. uploade flere kundelister (evt. dynamisk setup) fx alle jeres nyhedsbrevsmodtagere og tidl. købere, således denne data kan aktiveres til at finde lign. brugere. Desuden er jeres liste over målgrupper relativt ustruktureret og bør derfor opstilles med mere deskriptive titler således vi kan verificere at vi aktiverer al aktuel data der er til rådighed. ', 13, 0, 83, 1, 2, 2, 0, 0),
(2432, 'Optimering af Display Kampagner', '9.00', '11.00', 3, 'Kampagnen \"Download katalog\" har målsætningen at skabe downloads af Eurodans inspirationskatalog. Dog kunne kreativer/kommunikation med fordel tilpasses målsætningen, således især kreativt materiale udgøres af billeder af kataloget. Dette vil gøre kommunikationen skarpere og vil sikre at budskabet er tydligere selv i små formater, hvor der kun er plads til et billede og en overskrift. Ligeledes kan der med fordel anvendes skarpere kommunikation i kampagnen \"Book møde - 2022\" hvis målsætning er generere møder.', 13, 0, 83, 1, 2, 2, 0, 0),
(2433, 'Kontinuerling håndtering og optimering af Google Ads setup ', '8.00', '9.00', 3, 'Løbende analyse, optimering og udviklingsarbejde i alle Google Ads\' relevante formater inkl. løbende performance og dataanalyse for Paid Search.', 13, 0, 83, 1, 2, 2, 0, 0),
(2434, 'Udvikling af contentplan med prioriterede indsatser på baggrund af efterspørgselsanalysen', '15.00', '17.00', 3, 'Med afsæt i efterspørgselsanalysen, dybdegående search intent analyse af efterspørgselstermerne heri samt en content gap analyse med jeres konkurrenter, udformes en komplet contentplan hvori al det content der skal produceres er udpenslet. Denne contentplan indeholder bl.a. hvilket format content skal være i, længde, deadline, meta data, topic clusters m.m. ift. at sikre onpage parametre er on point.', 13, 0, 83, 1, 2, 1, 0, 0),
(2435, 'Dybdegående linkprofilanalyse', '11.00', '12.00', 3, 'Før vi igangsætter off-site arbejdet, dvs. arbejdet med at bygge links, analyseres jeres nuværende situation/linkprofil benchmarked mod konkurrenter, samt analyse af links blandt partnere. Linkanalysen giver indsigt i hvilke actions vi bør foretage fremadrettet for at sikre de optimale forudsætninger for organisk synlighed. Output er en linkbuildingplan og strategi herfor.', 13, 0, 83, 1, 2, 1, 0, 0),
(2436, 'Løbende linkbuilding indsats og link-overvågning (inkl. forfatning af linkbuilding artikler men ekskl. retterunde)', '5.00', '6.00', 3, 'Mhp. at skabe autoritet og derigennem outranke konkurrenter i Google publiceres artikler på mndl. basis på udvalgte, relevante online medier som linker til udvalgte Eurodan Huse landingpages', 13, 0, 83, 1, 2, 1, 0, 0),
