(2698, 'Content offer Google Ads', '25.00', '30.00', 3, 'Hej Jakob.\n\nSom vi snakkede om, så må du gerne komme med et oplæg på, hvordan vi kan lave en slags værktøjskasse eller lignende til CMOer i e-commerce. Som vi snakkede om, så kunne det være fedt med noget, der kunne hjælpe med at de sikrede eksempelvis: Oppetid, at de rammer de rigtige, sikrer de måler på det rigtige el. lign. Gerne noget som kan hjælpe dem i hverdagen med at gøre tingene hurtigere. Tid og ressourcer er en kæmpe pain for dem, som jeg gerne vil tale ind i og hjælpe med.\n\nHer får du lige de bullets, vi snakkede om:\n- Scripts\n- Tjekliste - kampagne og konverteringstracking\n- Rapportering \n- Standard-negativlister\n\n', 14, 0, 58, 1, 1, 7, 0, 0),
