(2826, 'Kampagne-håndtering, sparring og sikring af kampagne-budskaber', '5.00', '6.00', 3, 'Løbende aktivering, sikring og sparring omkring kampagner og budskaber, så vi understøtter sæson, marked og årshjul, samt evt. adhoc kampagner', 14, 0, 83, 1, 2, 8, 0, 0),
(2827, 'Optimering af kreativer/assets i de forskellige kanaler', '2.00', '3.00', 0, 'Løbende sparning om og optimering af assets i de forskellige kanaler inkl. fintuninger og opfølgende briefs, så vi sikrer kreativer udvikles i takt med vi får performance-data ind.', 14, 0, 83, 1, 2, 9, 0, 0),
(2828, 'Opsætning af Conversion API (Via Google tag manager) - Deadline 18. november', '6.00', '8.00', 3, 'Conversion API bidrager til at oprette en direkte og pålidelig forbindelse mellem markedsføringsdata fra jeres server, websiteplatform eller CRM til Meta. Disse markedsføringsdata bidrager til annoncetilpasning, optimering og måling på Meta, så jeres annoncer vises til personer, der med større sandsynlighed vil være interesseret i dem.', 15, 0, 83, 1, 2, 6, 0, 0),
(2829, 'Pinterest - Tracking setup', '5.00', '7.00', 3, 'Tracking setup - opsætning af pixel inkl. micro, makro events inkl custom parametre, relevante for targeting og algoritmisk datagrundlag. ', 14, 0, 83, 1, 2, 6, 0, 0),
(2830, 'Pinterest - Opbygning af kampagnestrukturer', '3.00', '4.00', 3, 'Opbygning af kampagnestrukturer, Kampagnestyring, optimering og sparring i test- og opstartsfase', 14, 0, 83, 1, 2, 3, 0, 0),
(2831, 'Kontinuerling håndtering og optimering af Paid Social', '6.00', '8.00', 3, 'Kontinuerling håndtering og optimering af Facebook setup for alle relevante formater og kanaler i deres netværk inkl løbende performance og dataanalyse på Paid Social', 14, 0, 83, 1, 2, 3, 0, 0),
(2832, 'Implementering af Performance Max', '4.00', '5.00', 3, 'Performance Max er et nyt kampagneformat som konsoliderer alt fra Search, Display, Youtube, Gmail, Discover og Maps i en kampagne. I har indtil videre ikke anvendt formatet, hvilket I anbefales at teste, da vi ser rigtig stærke resultater på tværs af andre cases. Formatet er bundet op på målgrupper frem for keywords og erstatter trods sin konsoliderede form ikke fundamentet i jeres setup, nemlig Search Ads.', 14, 0, 83, 1, 2, 2, 0, 0),
(2833, 'Optimering af Display Kampagner', '6.00', '7.00', 3, 'Kampagnen \"Download katalog\" har målsætningen at skabe downloads af Eurodans inspirationskatalog. Dog kunne kreativer/kommunikation med fordel tilpasses målsætningen, således især kreativt materiale udgøres af billeder af kataloget. Dette vil gøre kommunikationen skarpere og vil sikre at budskabet er tydligere selv i små formater, hvor der kun er plads til et billede og en overskrift. Ligeledes kan der med fordel anvendes skarpere kommunikation i kampagnen \"Book møde - 2022\" hvis målsætning er generere møder.', 14, 0, 83, 1, 2, 2, 0, 0),
(2834, 'Kontinuerling håndtering og optimering af Google Ads setup ', '8.00', '9.00', 3, 'Løbende analyse, optimering og udviklingsarbejde i alle Google Ads\' relevante formater inkl. løbende performance og dataanalyse for Paid Search.', 14, 0, 83, 1, 2, 2, 0, 0),
(2835, 'Gennemgang og optimering af nuværende meta data på vigtigste sider samt kvartalvis evaluering af CTR udvikling inkl. handleplan for kommende kvartal', '9.00', '10.00', 3, 'Vi sikrer at jeres vigtigste sider er optimeret i form af meta data (title-tags og meta descriptions) de steder der måtte være behov for det. CTR er generelt dalende for Organic Search, derfor vigtigt vi tager kontrol over budskaberne og tester forskellig kommunikation og lægger kvartalsvise handlingsplaner ift. at sikre fremdrift. Denne indbefatter også at tappe ind i SERP features samt opnå rige søgeresultater med implementeringen af Scheme Mark up, som fx FAQ.', 14, 0, 83, 1, 2, 1, 0, 0),
(2836, 'Opfølgning på findings i teknisk SEO site audit', '3.00', '5.00', 3, 'For at sikre at problematikkerne og løsningsforslagene fra site audit rapporten håndteres korrekt laver vi Quality Assurance på disse ændringer når de foretages på sitet', 14, 0, 83, 1, 2, 1, 0, 0),
(2837, 'Løbende linkbuilding indsats og link-overvågning (inkl. forfatning af linkbuilding artikler men ekskl. retterunde)', '5.00', '6.00', 3, 'Mhp. at skabe autoritet og derigennem outranke konkurrenter i Google publiceres artikler på mndl. basis på udvalgte, relevante online medier som linker til udvalgte Eurodan Huse landingpages', 14, 0, 83, 1, 2, 1, 0, 0),
(2839, 'Display kampagner', '8.00', '10.00', 3, 'Opsætning, optimering og styring af display kampagner. Scopet til at køre via Google Ads Display. Dog kan det give mening at køre DV360 eller Adform. Kreativer laves af Eurodan', 15, 0, 83, 1, 2, 2, 0, 0),
