(3466, 'Tilgangssiden skal inkludere AI og være meget mere konkret (rewamp)', '4.00', '6.00', 3, '<p><a href=\"https://www.kynetic.dk/tilgang/\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.kynetic.dk/tilgang/</a></p><p><br></p><p>Opbygning:</p><ul><li>Beskrivelsen af ydelsen: Start med en kort, men præcis beskrivelse af ydelsen, der forklarer, <strong>hvad den gør</strong>, og hvordan den kan hjælpe kunden.</li><li>Fordele for kunden: Beskriv de forskellige fordele, som kunden kan få ved at vælge din ydelse. Fokuser på de resultater, du kan hjælpe kunden med at opnå, og <strong>hvordan </strong>det kan hjælpe dem med at nå deres mål.</li><li>Sektion med referencer eller citat</li><li>FAQ-sektion</li><li>Kontakt-CTA</li></ul><p><br></p><p>Tænk visuelt indhold ind: Hvad bør vi inkludere i form af billeder, videoer eller infografikker til at illustrere ydelsen og dens fordele.</p>', 19, 0, 58, 1, 1, 7, 0, 0),
(3467, 'e-commerce marketing rewamp', '9.00', '11.00', 3, '<p><a href=\"https://www.kynetic.dk/services/digital-strategi/ecommerce-marketing/\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.kynetic.dk/services/digital-strategi/ecommerce-marketing/</a></p><p><br></p><p>Opbygning:</p><ul><li>Beskrivelsen af ydelsen: Start med en kort, men præcis beskrivelse af ydelsen, der forklarer, <strong>hvad den gør</strong>, og hvordan den kan hjælpe kunden.</li><li>Fordele for kunden: Beskriv de forskellige fordele, som kunden kan få ved at vælge din ydelse. Fokuser på de resultater, du kan hjælpe kunden med at opnå, og <strong>hvordan </strong>det kan hjælpe dem med at nå deres mål.</li><li>Sektion med referencer eller citat</li><li>FAQ-sektion</li><li>Kontakt-CTA</li></ul><p><br></p><p>Tænk visuelt indhold ind: Hvad bør vi inkludere i form af billeder, videoer eller infografikker til at illustrere ydelsen og dens fordele.</p>', 18, 0, 58, 1, 1, 7, 0, 0),
