(3962, 'Blogindlæg Headless e-handel', '2.50', '3.00', 3, '<p>Content brief her: <a href=\"https://docs.google.com/document/d/1De_F4m3WaBpFciwhjNI1u3j1trxV2cSIL-3siP0c_uE/edit#\" target=\"_blank\">https://docs.google.com/document/d/1De_F4m3WaBpFciwhjNI1u3j1trxV2cSIL-3siP0c_uE/edit#</a></p><p><br></p><p>Blogindlæg her: <a href=\"https://docs.google.com/document/d/1De_F4m3WaBpFciwhjNI1u3j1trxV2cSIL-3siP0c_uE/edit#heading=h.q9gv4z7y917u\" target=\"_blank\">https://docs.google.com/document/d/1De_F4m3WaBpFciwhjNI1u3j1trxV2cSIL-3siP0c_uE/edit#heading=h.q9gv4z7y917u</a></p>', 18, 0, 58, 1, 1, 7, 0, 0),
(3974, 'Blogindlæg Performance marketing e-commerce', '15.00', '18.00', 3, '<p>Link til content brief: https://docs.google.com/document/d/1q4vSzRFIKaP53IYomb7EoS1R9ydbmwwOM-QMDEYJhKc/edit#</p><p><br></p><p>Her er et par af vores nyeste blogindlæg, som meget passer med niveau og format af den tone og stil vi gerne vil ramme:</p><p><br></p><p>https://www.kynetic.dk/blog/hvor-meget-skal-vi-investere-i-marketing-marketingbudgettets-rolle-i-jeres-digitale-vaekst/</p><p><br></p><p>https://www.kynetic.dk/blog/bedre-beslutninger-drevet-af-ai/</p>', 24, 0, 58, 1, 1, 7, 0, 0),
(3986, 'Blogindlæg Strategi e-commerce', '3.50', '3.50', 3, '<p>Deadline: 19/4 2023</p><p><br></p><p>Content brief: <a href=\"https://docs.google.com/document/d/1GCX3kBLwHSSFRtUzC3TazfoxucIlQJkLKEbCHPijhxo/edit#heading=h.3utrtq2bbci\" target=\"_blank\">https://docs.google.com/document/d/1GCX3kBLwHSSFRtUzC3TazfoxucIlQJkLKEbCHPijhxo/edit#heading=h.3utrtq2bbci</a></p>', 20, 0, 58, 1, 1, 7, 0, 0),
(3998, 'Optimering: Omnichannel marketing', '3.00', '5.00', 3, '<p><a href=\"https://www.kynetic.dk/services/digital-strategi/omnichannel-marketing/\" target=\"_blank\">https://www.kynetic.dk/services/digital-strategi/omnichannel-marketing/</a></p><p><br></p><p><strong>Skal være fokuseret på e-commerce-kunder</strong></p><p><br></p><p>Opbygning:</p><ul><li>Beskrivelsen af ydelsen: Start med en kort, men præcis beskrivelse af ydelsen, der forklarer, <strong>hvad den gør</strong>, og hvordan den kan hjælpe kunden.</li><li>Fordele for kunden: Beskriv de forskellige fordele, som kunden kan få ved at vælge din ydelse. Fokuser på de resultater, du kan hjælpe kunden med at opnå, og <strong>hvordan </strong>det kan hjælpe dem med at nå deres mål.</li><li>Sektion med referencer eller citat</li><li>FAQ-sektion</li><li>Kontakt-CTA</li></ul><p><br></p><p>Tænk visuelt indhold ind: Hvad bør vi inkludere i form af billeder, videoer eller infografikker til at illustrere ydelsen og dens fordele.</p>', 21, 0, 58, 1, 1, 7, 0, 0),
