(5213, 'Redesign servicesider', '3.00', '3.00', 3, '<p>Vores servicesider har brug for en rewamp. De er svære at få til at se lækre ud, og herobillede fylder rigtig meget over folden. Derudover er der på vores nuværende templates noget rod med H-tags, som er dårligt for SEO. Det skal fikses, så vi ikke har alle mulige mærkelige tags i forkert rækkefølge og H-tags der bruges til andet end overskrifter.</p>', 22, 0, 58, 1, 1, 5, 0, 0),
