(5258, 'Serviceside: Tech-side', '10.00', '15.00', 3, '<p>Side der illustrerer og beskriver, hvilke platforme, vi har erfaring med, og hvordan vi arbejder med det.</p><p>Skal indeholde: Vores tilgang til anvendelse af tech, vores eget stack, + 2. og 3. parts stack vi anvender, best of breed tilgang, osv...)</p><p><br></p><p>Opbygning:</p><ul><li>Beskrivelsen af ydelsen (vores brede erfaring med mange forskellige platforme): Start med en kort, men præcis beskrivelse af ydelsen, der forklarer, <strong>hvad den gør</strong>, og hvordan den kan hjælpe kunden.</li><li>Fordele for kunden: Beskriv de forskellige fordele, som vores best of breed tilgang giver kunden. Fokuser på de resultater, du kan hjælpe kunden med at opnå, og <strong>hvordan </strong>det kan hjælpe dem med at nå deres mål ved hjælp af den tilgang og erfaring vi har med mange forskellige platforme.</li><li>Sektion med referencer eller citat</li><li>FAQ-sektion</li><li>Kontakt-CTA</li></ul><p><br></p><p>Tænk visuelt indhold ind: Hvad bør vi inkludere i form af billeder, videoer eller infografikker til at illustrere ydelsen og dens fordele. Visualisering af de platforme, vi har erfaring med</p><p><br></p><p><br></p>', 19, 0, 58, 1, 1, 7, 0, 0),
