(5290, 'Opdatere Tracking sektion i WIKI', '3.00', '4.00', 3, '<p>Lad vær at lave en side til hver tracking implementering, men lav i stedet en side i WIKI\'en som lister hvert tracking tiltag beskrevet kortfattet i 2-3 sætninger: https://www.notion.so/kynetic/Tracking-8a4e6e0390f84313a67649922f4b7716</p><p><br></p><p><br></p><ul><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Enhanced tracking</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Micro conversions</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Kundelister</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Remarketing Målgrupper</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Profitoptimering</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Testing af tools</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Uddanne kunderne + lykkes med at sælge dette ind/mere forudseende ift. allokering af optimeringstimer på enkelte cases.</span></li></ul><p><br></p>', 25, 0, 56, 1, 1, 2, 0, 0),
(5291, 'WIKI om product performance håndtering i Google Ads', '3.00', '4.00', 3, '<p>Vær kortfattet ved at beskrive problemstillingen og hvordan vi bør arbejde med få indsigt i produkt performance/peakperiods og introducér i product scoring i den forbindelse: https://www.notion.so/kynetic/Product-performance-31a3d8fdaa0746e69f7be980d55d5ef8</p><p><br></p><ul><li><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Vi skal lykkes med at pushe de rette produkter på de rette tidspunkter.</span></li><li><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Udfordringer:</span></li><li class=\"ql-indent-1\"><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Sæson</span></li><li class=\"ql-indent-1\"><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Lagerstatus</span></li><li class=\"ql-indent-1\"><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Tilbud</span></li><li><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Trends</span></li><li class=\"ql-indent-1\"><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Nye varer</span></li></ul><p><br></p><p><br></p>', 23, 0, 56, 1, 1, 2, 0, 0),
