(5293, 'Lave blogindlæg (Defineres i samarbejde med KO)', '9.00', '10.00', 3, '<p>Kom selv med nogle ideer til hvad du ønsker at skrive om. Dette er starten på at udgive 6 hero contentpieces, så lad os finde nogle hot topics der understøtter og eksemplificerer det vi kan.</p>', 23, 0, 56, 1, 1, 2, 0, 0),
(5294, 'Lave kort slidedeck til at sende ud til vores kunder vedr. tracking.', '5.00', '6.00', 3, '<p>Vi skal have underrettet alle vores kunder vedr. tracking og i samme ombæring have solgt noget mere ind til optimering af dette.</p>', 24, 0, 56, 1, 1, 2, 0, 0),
(5295, 'Definition af optimeringsprocesser i Google Ads', '9.00', '10.00', 3, '<p><br></p>', 24, 0, 56, 1, 1, 2, 0, 0),
