(5298, 'YT creative way of work', '8.00', '9.00', 0, '<p>Vi skal have konceptualiseret hvordan vi arbejder med YT. Det vil sige vi skal have samlet nogle cases på YT de steder hvor vi har kørt det, og have lavet noget materiale på det. Ligeledes skal vi have dokumenteret det hele i WIKI\'en i et kortfattet format.</p><p>Herunder hvordan vi arbejder med det kreative element, nu hvor video fylder så meget i Google Ads.</p><p><br></p><ul><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Best practice for kreativer - strukturering &amp; opbygning af video til sikring af effektivitet. Herunder udbygning af dokumentation (template/checkliste) til kunder.</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Best practices for optimering - Definition af procedure for effektmåling</span></li></ul><p><br></p><p>Tag lige fat i mig (KO) ifm. opgaven.</p><p><br></p>', 19, 0, 56, 1, 1, 2, 0, 0),
