(5375, 'MANGLER GODKENDELSE - DEV: Evt. tilpasning af tema: Sikring af synlige USP', '1.00', '2.00', 3, '<p>Done: Eksempel kan ses på produkter.</p><ul><li>f.eks.: <u>https://northern-hunting-8509.myshopify.com/products/ada-anthracite-kvinde-fleece</u>)</li><li>billede eksempel: https://northern-hunting-8509.myshopify.com/products/ada-anthracite-kvinde-fleece</li></ul><p><br></p><p>USP\'er er lagt på de forskellige sprog, når DK bliver sat som standard (locale) sprog, vil DK selvfølgelig fremtræde på den danske version, og de andre sprog på deres respektive.</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5376, 'DEV: Udvikling af op til 5 custom elementer', '11.00', '11.00', 3, '<p>+ Element til collection side (produktbeskrivelse i bunden)</p><p>+ Custom produkt beskrivelses sektion</p><ul><li>Se \"TEST PRODUCT - Sample\" produktet (<u>https://8ufajdv6uoee6cdp-72708522324.shopifypreview.com/products_preview?preview_key=b1975d9d6a6b59a7945cab24631cb067</u>)</li><li>Oprettet custom fields sektion, med mulighed for at indsætte 2 billeder på vilkårligt produkt.</li><li>Man kan croppe billedet når man indsætter en billede.</li><li>Der er lavet fallback hvis product billede ikke er indsat:</li><li class=\"ql-indent-1\">https://gyazo.com/e3e6924847f0ff0aecbf864ff9988a6d</li><li>Hvis produkt billeder er indsat ser det således ud:</li><li class=\"ql-indent-1\">https://gyazo.com/8adadabe5a0d952045ecd35eec4d5665</li></ul>', 20, 0, 79, 1, 2, 5, 0, 0),
(5377, 'DEV: Onepage bundles', '4.00', '4.00', 3, '<p><span style=\"color: rgb(65, 62, 104);\">Done: Se eksempel på følgende produkt:</span></p><ul><li>https://northern-hunting-8509.myshopify.com/products/ake-green-jagt-fleece</li><li>https://gyazo.com/b8d050b64dc5a5c267f74d42113ae388</li></ul><p><br></p><p>Eksempel på product bundle landing page</p><ul><li>https://northern-hunting-8509.myshopify.com/a/bundles/bundle-test-60ym</li><li>https://gyazo.com/efd1d767a4a14377d1408434d5f5d1d0</li></ul><p><br></p><p><strong>Bemærk: </strong>Opgaven er done funktionalitets-mæssigt. Mangler stadigvæk styling. Kommer efterfølgende.</p><p><br></p><p><strong>Bemærk: \"Bundler - Product Bundles\" app er blevet installeret og købt ($ 6.99/måned). Den er nødvendig for landing pages</strong></p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5378, 'DEV: Opsætning af forskellige universer; fx bukkejagt, after hunt og preworn. Layout twist skal indikere i hvilket univers man befinder sig', '4.00', '4.00', 3, '<p>Noter:</p><ul><li>Under pages, er der lavet et custom field \"Universe\", hvor man kan vælge hvilket universe som siden tilhører.</li><li>Afhængigt af valg, ændre udseendet sig (WIP).</li></ul>', 20, 0, 79, 1, 2, 5, 0, 0),
(5379, 'DEV: Video på produktsider inkl. placeholderbillede', '3.00', '3.00', 3, '<p>Done - eksempel kan ses på: https://northern-hunting-8509.myshopify.com/collections/test-collection/products/test-product-draft-video</p><p><br></p><p>Video kommer på galleri.</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5380, 'DEV: Størrelsesguide differenteret efter kvinde, herre, accessories', '2.00', '2.00', 3, '<p>DONE: </p><ul><li>Funktionalitet og styling er done. Kan ses på virlkårligt produkt.</li><li>Bemærk at størrelses-guides skal selv oprettes. Kan oprettes under: \"Pages\" &gt; \"Size Chart\" &gt; \"More Actions\" &gt; \"Custom Fields\". Heri skal custom fields blot udfyldes, der kan tilføjes så mange size-guides som ønsket.</li></ul>', 20, 0, 79, 1, 2, 5, 0, 0),
(5381, 'DEV: Visualiserede productspecs pba. af produktets funktionaliteter', '3.00', '3.00', 3, '<p><br></p>', 20, 0, 79, 1, 2, 5, 0, 0),
(5382, 'DEV: Filtrering på kategorisider: Størrelse, Køn, Årstid, Camouflage, Temperatur, Egenskaber, Farver ', '2.00', '2.00', 3, '<p>WIP: Følgnede filtrering er done: (se <u>https://jy310en3q0el4xyt-72708522324.shopifypreview.com/collections/all</u>)</p><ul><li>Størrelse</li><li>Camouflage</li><li>Længde</li><li>Farver</li><li>Pris-niveau</li><li>Tilgængelighed</li><li>Egenskaber</li></ul><p><br></p><p>Der er problemer med \"Køn\" og \"Årstid\" import eftersom de indeholder special-tegn. Shopify support er kontaktet.</p><p><strong>Svar fra Shopify support: </strong>Køn/Årstid skal omdøbes når de importeres fra WooCommerce, så de ikke indeholder specialtegn (æøå). Vi kan Efterfølgende i frontend ændre det.</p><p><br></p><p>Jeg har oprettet \"Køn\" og \"Årstid\" på test produkter, så filtrene virker, men produkterne skal selvfølgelig linkes.</p><p><br></p><p>Bemærk venligst at disse filtrerings-muligheder er et direkte result af import fra WooCommerce. Dvs. den struktur der er bygget i WooCommerce er blevet adapteret til Shopify.</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5383, 'DEV: Ved hover på produktbillede i collections vises billede nr. 2 samt tilgængelige størrelser og farvevarianter', '3.00', '3.00', 3, '<p>Done: ved hover vises billede nr. 2</p><p>Done: tilgængelige farve-varianter</p><p>Done : tilgængelige størrelser</p><p><br></p><p>Eksempel: https://northern-hunting-8509.myshopify.com/collections/test-collection</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5384, 'DEV: Udvikling af indikation til brugeren af hvor mange der er på lager af en given variant, fx \"Få på lager\", \"Én tilbage\" mv.', '2.00', '3.00', 3, '<p>Done: Se eksempel på <u>https://northern-hunting-8509.myshopify.com/products/test-product-sample?variant=46477540786516.</u></p><p><br></p><p>Løsningen viser kun \"antallet\" der er tilbage.</p><p><br></p><p><strong>Obs.: Vælg medium for at se ændringer (!)  </strong></p><p><br></p><p>Billede eksempel: https://gyazo.com/ed5a88ececac5ede7c689ccb5f881262</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5385, 'DEV: Ved læg i kurv: Pop up med relaterede produkter', '4.00', '4.00', 3, '<p>Done: eksempel kan ses ved hvert produkt. Reglen er lavet således at når et produkt bliver tilføjet i kurven, vises lignede/relaterede produkter (max 4), ifht. kollektion. </p><p><br></p><p>Se eksempel: https://northern-hunting-8509.myshopify.com/products/ada-anthracite-kvinde-fleece</p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5386, 'DEV: Optimal håndtering af bundles, dvs. muligheden for at vælge størrelsesvarianter for alle produkter i en given bundle på én produktside', '4.00', '4.00', 3, '<p><br></p>', 19, 0, 79, 1, 2, 5, 0, 0),
(5387, 'DEV: Buffer til diverse uforudsete tilpasninger', '6.00', '6.00', 3, '<p><br></p>', 20, 0, 79, 1, 2, 5, 0, 0),
(5388, 'DEV: Rabathåndtering: \"Køb 2 produkter og få 20%\" el. \"Få gratis X ved køb af Y\" (altså automatisk tilføjelse til kurv)', '3.00', '3.00', 3, '<p>Done / WIP: Der</p><ul><li>Køb 2 produkter og få 20%, eksempel:</li><li class=\"ql-indent-1\">https://gyazo.com/296b2ee47a2a35347c918d734b0baaf3</li><li>Få gratis X ved køb af Y, eksempel:</li><li class=\"ql-indent-1\">https://northern-hunting-8509.myshopify.com/admin/discounts/1571101704532</li></ul><p><br></p><p>Bemærk at \"Få gratis X ved køb af Y\" først fremgår ved checkout. Der skal evt. laves en regel som fortæller at hvis der er discount på produktet i denne type form, så skal det vises på en bestemt måde i frontend. Dette kan opgaven \"DEV: Udvikling af op til 5 custom elementer\" evt. bruges til.</p><p><br></p><p>Men funktionaliteten til de forskellige rabathåndtering virker og sker automatisk. Rabat på %/pris sker ved kurv/kasse.</p>', 19, 0, 79, 1, 2, 5, 0, 0),
