(5428, 'CRO', '8.00', '10.00', 3, '<ol><li>Træk en liste på de mest besøgte sider i Google Analytics: https://docs.google.com/spreadsheets/d/1Or49P3P6-0mKlc3htSwaEK3V89Gswo32LffXABHLUm4/edit#gid=1394201857 </li><li>Tjekke de mest sete sider igennem og finde eventuelle udfordringer (Hotjar)</li></ol>', 24, 0, 58, 1, 1, 7, 0, 0),
