(5436, 'Sociale medier serviceside rewamp', '6.00', '8.00', 3, '<p>https://www.kynetic.dk/services/sociale-medier/</p><p><br></p><p>Opbygning:</p><ul><li>Beskrivelsen af ydelsen: Start med en kort, men præcis beskrivelse af ydelsen, der forklarer, <strong>hvad den gør</strong>, og hvordan den kan hjælpe kunden.</li><li>Fordele for kunden: Beskriv de forskellige fordele, som kunden kan få ved at vælge din ydelse. Fokuser på de resultater, du kan hjælpe kunden med at opnå, og <strong>hvordan </strong>det kan hjælpe dem med at nå deres mål.</li><li>Sektion med referencer eller citat</li><li>FAQ-sektion</li><li>Kontakt-CTA</li></ul><p><br></p><p>Tænk visuelt indhold ind: Hvad bør vi inkludere i form af billeder, videoer eller infografikker til at illustrere ydelsen og dens fordele.</p>', 19, 0, 58, 1, 1, 7, 0, 0),
(5437, 'SEO audit på service-sider', '8.00', '10.00', 3, '<ol><li>Hvilke servicesider ranker vi på?</li><li>Er det de rigtige ord, vi bruger om vores services?</li><li>Er der nogle servicesider, vi kunne ændre wording på for at ranke på noget der er efterspørgsel på?</li><li>Overblik over løse \"servicesider\"</li></ol>', 20, 0, 58, 1, 1, 1, 0, 0),
(5439, 'KVUC Morebizz: Opsætning af 2 stk. konverteringshandlinger i Google Ads / GTM', '1.00', '2.00', 3, '<p>der er tale om flg. konv. handlinger som efter Rikke har opsat i Google Ads skal konfig. med GTM:</p><ul><li>Book tid til vejledning (HF) (Website data - ekskl. intern trafik) som er en formularindsendelse via&nbsp;<a href=\"https://kvuc.dk/vejledning/hf-vejledningen/book-tid/\" target=\"_blank\" style=\"color: rgba(var(--sk_highlight,18,100,163),1);\">https://kvuc.dk/vejledning/hf-vejledningen/book-tid/</a></li><li>O: Tilmelding til 2-årig HF (Website data - ekskl. intern trafik) - som er et klik på en CTA til&nbsp;<a href=\"http://optagelse.dk/\" target=\"_blank\" style=\"color: rgba(var(--sk_highlight,18,100,163),1);\">optagelse.dk</a></li><li class=\"ql-indent-1\">Denne CTA findes på flg. sider:&nbsp;<a href=\"https://kvuc.dk/uddannelser/hf/2-aarig-hf/\" target=\"_blank\" style=\"color: rgba(var(--sk_highlight,18,100,163),1);\">https://kvuc.dk/uddannelser/hf/2-aarig-hf/</a>&nbsp;</li></ul><p><br></p>', 19, 0, 38, 1, 2, 6, 0, 0),
