(5815, 'Flowmails og LP-indhold til Google Ads-whitepaper', '2.00', '2.00', 3, '<p>Opgaven går ud på at forfatte en takkemail med relateret indhold, som vi kan sende gennem AC til dem, der har downloadet Google Ads-whitepaperet. Dertil en email eller to som fungerer lidt som et nyhedsbrev med relateret viden - behøver ikke være noget vi har på bloggen, men må gerne - det kan også være bomustips til dem, der allerede har downloadet whitepaperet - så det fungerer lidt som en føljeton a la - har du været whitepaperet igennem? Fandt du nogle huller, og er du klar til at komme videre, så kommer jeg lige med tre tips...</p><p><br></p><p>Dertil skal vi bruge noget tekst til landning pagen som iscenesætter whitepaperet - hvem henvender det sig til, hvad får man, hvilken udfordring løser det?</p>', 21, 0, 58, 1, 1, 7, 0, 0),
