(5895, 'Format for paneldebat eller andre alternative formater', '2.00', '3.00', 3, '<ol><li>Panel Diskussion: Dette format er en samtale mellem flere eksperter om et bestemt emne. Du kunne invitere 3-4 eksperter inden for forskellige områder af digital marketing. Kan både være inhouse eller partnere. Disse eksperter kan dele deres unikke perspektiver og erfaringer. Kræver vi har nogle forberedte spørgsmål for at få diskussionen i gang, og derefter åbne op for spørgsmål fra deltagerne. Her er der en moderator til at styre diskussionen og sørge for, at den forbliver fokuseret og relevant.</li></ol><p><br></p><ol><li>Q&amp;A Sessions: Dette format er en åben diskussion, hvor deltagerne har mulighed for at stille spørgsmål. Du kan enten reservere en del af webinaret til en Q&amp;A session, eller du kan lave hele webinaret som en Q&amp;A session. Vi kan lade deltagerne indsende spørgsmål på forhånd, så vi kan forberede grundige svar, eller vi kan lade dem stille spørgsmål live under webinaret. Her skal vi nok selv formulere en masse spørgsmål selv, for at det ikke bliver kikset, hvis folk nu ikke er med på legen. Jeg ser det som en slags interview. Kunne også laves som lives. Det er dog lidt kikset, hvis der så ikke er nogen der skriver med spørgsmål</li></ol><p><br></p>', 24, 0, 58, 1, 1, 14, 0, 0),
(5896, 'Rette bugs og UI-uhensigtsmæssigheder på KYNETIC website (især på mobil)', '40.00', '45.00', 3, '<p>Oversigt over uhensigtsmæssigheder her: https://docs.google.com/spreadsheets/d/1X_0n-mc3hZE4rQkeViV8IDwv-PMo7BP_VRMv3hnJML0/edit#gid=0</p>', 22, 0, 58, 1, 1, 5, 0, 0),
(5897, 'Fysisk outreach til e-com benchmark emner', '25.00', '28.00', 2, '<p>Der skal designes et \"brev\". Vi skal finde frem til kontaktpersonen, adresse og skrive et lille personligt afsnit om, hvordan de ranker i analysen, og hvor det fremgår, at det er et personligt skriv</p><p><br></p><p>Her er teksten til brevet: https://docs.google.com/document/d/1YExXOb6LhWawND-yzTu4Rrls_LbxgjqhskSgPJ-64o0/edit</p>', 26, 0, 58, 1, 1, 7, 0, 0),
