(6057, 'Finde billeder til E-com Benchmark branchebokse', '2.00', '3.00', 3, '<p>Vi skal have fundet nogle billeder som Drilon kan bruge til de bokse på E-com-sitet med brancher. Billederne skal være 1080x1080 - vær opmærksom på de ikke bliver for store KB-mæssigt (max 150 KB)</p><p>. lægges her: https://drive.google.com/drive/u/0/folders/15gpg7dKMzbnhH6A6VH5fBf2E7Hfp4IOR</p>', 22, 0, 58, 1, 1, 5, 0, 0),
(6058, 'Grafikker til servicesider', '18.00', '20.00', 3, '<p>Nye grafikker til servicesider, så de passer med vores visuelle identitet. Vær obs på ikke at ændre for meget i det originale koncept.</p>', 22, 0, 58, 1, 1, 9, 0, 0),
(6059, 'Opdatere website med nye top-billeder og nye grafikker', '15.00', '20.00', 3, '<p>Du må meget gerne opdatere websitet med de nye grafikker samt lægge nye herobilleder på alle undersider til servicesider - her kan vi godt leve med at det er stockbilleder - ellers bliver det for redundant. Jeg har lavet et overblik over siderne i contentplanen: https://docs.google.com/spreadsheets/d/174RUB8TWd8sExlrbJIPLqV0fBREoX2q7cLUzj-ZsRd0/edit#gid=834021718</p>', 22, 0, 58, 1, 1, 9, 0, 0),
(6060, 'Marketing e-handelskonferencen', '5.00', '6.00', 3, '<p>SoMe-kit her: https://assets.adobe.com/public/6ae99514-a78e-4c83-67dd-eceb14417668</p><p><br></p><p><strong>Marketing</strong></p><p>·&nbsp;&nbsp;&nbsp;&nbsp;Husk at markedsføre E-handelskonferencen 2023, jf. kontrakten&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"https://shared-assets.adobe.com/link/6ae99514-a78e-4c83-67dd-eceb14417668\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Her er et SoMe-kit</a>, som I kan bruge til branding af konferencen</p><ul><li class=\"ql-indent-2\">Ønskes der et andet format skriv endelig til os</li></ul><p>·&nbsp;&nbsp;&nbsp;&nbsp;Vi vil meget gerne modtage screenshots og links til jeres markedsføringstiltag&nbsp;løbende</p><ul><li class=\"ql-indent-2\">Blogs, artikler, post, nyheder etc. vil vi gerne sende videre til vores kommunikationsafdeling</li></ul><p>&nbsp;</p><p>I er velkomne til at lave jeres eget markedsføringsmateriale og markedsføre det på tværs af jeres kanaler. Vi vil dog i så fald bede om, at alt markedsføringsmateriale inkluderer \"E-handelskonferencen 2023\" eller \"The E-commerce Summit 2023\" samt Dansk Erhverv logo (vedhæftet denne mail). Hvis I anvender SoMe, så tag os gerne #danskerhvervdigitalhandel.&nbsp;</p><p>Konferencelinket findes her:&nbsp;&nbsp;<a href=\"https://www.danskerhverv.dk/kurser-og-events/2023/oktober/e-handelskonferencen-2023/\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">E-handelskonferencen 2023 (danskerhverv.dk).</a>&nbsp;&nbsp;</p>', 24, 0, 58, 1, 1, 15, 0, 0),
